-- PROCEDURES & TRIGGERS

CREATE OR REPLACE TRIGGER TRG_SUBSCRIPTION_HISTORY_DEL
AFTER DELETE ON TBLT_SUBSCRIPTION FOR EACH ROW
BEGIN
    IF DELETING THEN
          INSERT INTO TBLT_SUBSCRIPTION_HISTORY
         (	SUBSCRIBER_ID      ,
          PACKAGE_ID             ,
          START_TIME           ,
		  END_TIME             ,
		  LAST_UPDATE_TIME     ,
		  STATUS               ,
		  SUBSCRIPTION_ID      ,
		  PARENT_IDENTITY      ,
		  SUBSCRIPTION_TIME    ,
		  REJECT_REASON

)
		  VALUES( :OLD.SUBSCRIBER_ID      ,
				  :OLD.PACKAGE_ID           ,
				  :OLD.START_TIME         ,
				  :OLD.END_TIME           ,
				  :OLD.LAST_UPDATE_TIME   ,
				  :OLD.STATUS             ,
				  :OLD.SUBSCRIPTION_ID    ,
				  :OLD.PARENT_IDENTITY    ,
				  :OLD.SUBSCRIPTION_TIME  ,
				  :OLD.PARAM1
                );
    END IF;

END;
/


