CREATE TABLE TBLM_PRODUCT_OFFER
(
	ID VARCHAR(36),
	NAME VARCHAR(100),
	DESCRIPTION VARCHAR(255),
	TYPE VARCHAR(32),
	SUBSCRIPTION_PRICE NUMERIC,
	CREDIT_BALANCE NUMERIC(20,6),
	AVAILABILITY_START_DATE TIMESTAMP(6),
	AVAILABILITY_END_DATE TIMESTAMP(6),
	PACKAGE_MODE VARCHAR(12) DEFAULT 'DESIGN',
	VALIDITY_PERIOD NUMERIC(8),
	VALIDITY_PERIOD_UNIT VARCHAR(20),
	DATA_SERVICE_PKG_ID VARCHAR(36),
	EMAIL_TEMPLATE_ID VARCHAR(36),
	SMS_TEMPLATE_ID VARCHAR(36),
	IS_FNF_OFFER NUMERIC(1) DEFAULT 0,
	PARAM_1 VARCHAR(100),
	PARAM_2 VARCHAR(100),
	STATUS VARCHAR(10),
	GROUPS VARCHAR(400),
	CURRENCY VARCHAR(5),
	CREATED_DATE TIMESTAMP(6),
	CREATED_BY VARCHAR(36),
	MODIFIED_DATE TIMESTAMP(6),
	MODIFIED_BY VARCHAR(36),
	CONSTRAINT PK_PRODUCT_OFFER primary key (ID),
	CONSTRAINT UK_PRODUCT_OFFER UNIQUE (NAME),
	CONSTRAINT FK2_PRODUCT_OFFER FOREIGN KEY(DATA_SERVICE_PKG_ID) REFERENCES TBLM_PACKAGE (ID),
	CONSTRAINT FK3_PRODUCT_OFFER FOREIGN KEY(EMAIL_TEMPLATE_ID) REFERENCES TBLM_NOTIFICATION_TEMPLATE(ID),
	CONSTRAINT FK4_PRODUCT_OFFER FOREIGN KEY(SMS_TEMPLATE_ID) REFERENCES TBLM_NOTIFICATION_TEMPLATE(ID),
	CONSTRAINT FK5_PRODUCT_OFFER FOREIGN KEY(CREATED_BY) REFERENCES TBLM_STAFF (ID),
	CONSTRAINT FK6_PRODUCT_OFFER FOREIGN KEY (MODIFIED_BY) REFERENCES TBLM_STAFF (ID)
);

COMMENT ON TABLE TBLM_PRODUCT_OFFER IS 'Stores product offer information';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.ID IS 'Stores unique identity';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.NAME IS 'Stores offer name';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.DESCRIPTION IS 'Stores offer description';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.TYPE IS 'Stores offer type';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.SUBSCRIPTION_PRICE IS 'Stores subscription price';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.CREDIT_BALANCE IS 'Stores initial monetary balance';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.AVAILABILITY_START_DATE IS 'Stores availability start date';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.AVAILABILITY_END_DATE IS 'Stores availability end date';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.PACKAGE_MODE IS 'Stores mode of the offer';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.VALIDITY_PERIOD IS 'Stores validity period';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.VALIDITY_PERIOD_UNIT IS 'Stores validity period unit';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.DATA_SERVICE_PKG_ID IS 'Stores id for data service package';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.STATUS IS 'Stores offer status';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.GROUPS IS 'Stores list of group ids';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.IS_FNF_OFFER IS 'Stores whether offer is FnF or Not. Possible values : 1(true) or 0(false)';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.PARAM_1 IS 'Stores optional parameter 1';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.PARAM_2 IS 'Stores optional paramter 2';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.CURRENCY IS 'Stores currency in which the price is configured.';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.CREATED_BY IS 'Store id of the staff who created this entity';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.CREATED_DATE IS 'Store Date on which this entity created';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.MODIFIED_BY IS 'Store id of the staff who modified this entity';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.MODIFIED_DATE IS 'Store Date on which this entity modified';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.EMAIL_TEMPLATE_ID IS 'Store id for subscription email notification';
COMMENT ON COLUMN TBLM_PRODUCT_OFFER.SMS_TEMPLATE_ID IS 'Store id for subscription sms notification';


CREATE TABLE TBLM_PRDCT_OFR_AUTO_SUBS_REL(
  ID VARCHAR(36),
  PARENT_PRODUCT_OFFER_ID VARCHAR(36),
  ADVANCED_CONDITION VARCHAR(4000),
  ORDER_NO NUMERIC(6),
  PRODUCT_OFFER_ID VARCHAR(36),
  CONSTRAINT PK_PRDCT_OFR_AUTO_SUBS_REL PRIMARY KEY (ID),
  CONSTRAINT FK1_PRDCT_OFR_AUTO_SUBS_REL FOREIGN KEY(PARENT_PRODUCT_OFFER_ID) REFERENCES TBLM_PRODUCT_OFFER (ID),
  CONSTRAINT FK2_PRDCT_OFR_AUTO_SUBS_REL FOREIGN KEY (PRODUCT_OFFER_ID) REFERENCES TBLM_PRODUCT_OFFER (ID)
);

COMMENT ON TABLE TBLM_PRDCT_OFR_AUTO_SUBS_REL IS 'Store information about auto subscribed producted offer relation';
COMMENT ON COLUMN TBLM_PRDCT_OFR_AUTO_SUBS_REL.ID IS 'Stores unique identity';
COMMENT ON COLUMN TBLM_PRDCT_OFR_AUTO_SUBS_REL.PARENT_PRODUCT_OFFER_ID IS 'Stores parent product offer id';
COMMENT ON COLUMN TBLM_PRDCT_OFR_AUTO_SUBS_REL.ADVANCED_CONDITION IS 'Stores advance condition for autosubscription of production offer';
COMMENT ON COLUMN TBLM_PRDCT_OFR_AUTO_SUBS_REL.ORDER_NO IS 'Stores order number of the auto-subscrption of product offer';
COMMENT ON COLUMN TBLM_PRDCT_OFR_AUTO_SUBS_REL.PRODUCT_OFFER_ID IS 'Stores AddOn product offer package id';

--BOD
CREATE TABLE TBLM_BOD
(
  ID                      VARCHAR(36),
  NAME                    VARCHAR(100) NOT NULL,
  STATUS                  VARCHAR(12) DEFAULT 'ACTIVE',
  DESCRIPTION             VARCHAR(2000),
  PACKAGE_MODE            VARCHAR(12) DEFAULT 'DESIGN',
  VALIDITY_PERIOD         NUMERIC(8),
  VALIDITY_PERIOD_UNIT    VARCHAR(20),
  QOS_PROFILE_NAMES       VARCHAR(4000),
