COMMENT ON TABLE TBLTAGGREGATEDPARTNERUSAGE IS 'Stores data of AGGREGATED PARTNER USAGE';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.LINE_OF_BUSINESS	IS '	Stores LoB alias to which EDR belongs.';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.SERVICE_NAME	IS '	Service: Voice, SMS, MMS, DATA, SIGNALLING etc.';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.ACCOUNT_IDENTIFIER	IS '	It is used to identify partner account which will guide rating to apply rating on EDRs. In case, EDR Split is done by PBSS, then this field will be populated by PBSS.';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_SESSION_TIME	IS '	Sum of Total duration of particular session received in EDRs';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_EVENT_QTY	IS '	Sum of Total Event Quantity of Session. This will be default "1" for Voice.';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.INGRESS_TRUNK_GROUP_NAME	IS '	Incoming Trunk Detail to identify incoming partner';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.EGRESS_TRUNK_GROUP_NAME	IS '	Outgoing Trunk Detail to identify outgoing partner';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_SESSION_DOWNLOAD_DATA	IS '	Sum of Session Download Volume received in EDRs';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_SESSION_UPLOAD_DATA	IS '	Sum of Session Upload Volume received in EDRs';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_SESSION_TOTAL_DATA	IS '	Sum of Total (Upload + Download) data volume received in EDRs';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TRAFFIC_TYPE	IS '	"Traffic Type to identify event for which EDRs to be aggregated for billing purpose. 
 For IDD/IC, value can be Incoming, outgoing, transit. For MVNO, value can be MVNO_IDD, MVNO_domestic, MVNO_Roaming. For content value can be CONTENT, SUBSCRIPTION, or AUDIO. For Signalling, value can be ANSI, NON_ANSI For Roaming, value can be ""Inbound Roaming"" or if CDRs coming from TAPIN then ""Outbound Roaming"""';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_SESSION_MONEY	IS '	Sum of Rated amount of EDR calculated by external system';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.SERVICE_PRICE	IS '	Content Charge for requested service.';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALL_TYPE	IS '	"Call type represents EDR type or Record Type coming from Network element. EMS will send ""as is value"" from NE.
 For Content, Captures the charging mode, value can be MO or MT..
  For Roaming: Voice, SMS EDRs: MO/ MTVideo EDRs: VIDMO/ VIDMTData EDRs: DATA For MVNO: VOICE, SMS, MMS EDRs :MO/MT DATA EDRs:N/A CPA EDRs:CPSMOZ, CPSMO,CPSMTZ, CPSMT, CPMSOZ, CPMSO, CPMSTZ, CPMST, CPWPL, CPWPLZ, CPWPH, CPWPHZ, CPUST, CPUSTZ, CPUSO, CPUSOZ, CPWEB, CPWEBZ"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_SERVICE_TYPE	IS '	"Calling service type represents Service type of A_Party subscriber.
 i.e: Fixed, Mobile, 1800, International, Special Service Etc…"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_SUBSERVICE_TYPE	IS '	"Calling subservice type represents Subservice type of A_Party subscriber.
 Mobile _ Prepaid, Mobile _ Postpaid, Voice Mail Etc.."';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_AREA_LEVEL1	IS '	"First level of A_Party Prefix area. Value can be vary based on Calling Service type Fix or Mobile
 Fix/Mobile: Island"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_AREA_LEVEL2	IS '	"Second level of A_Party Prefix area. Value can be vary based on Calling Service type Fix or Mobile
 Fix: Area Code
 Mobile: Mobile Region"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_OPERATOR	IS '	Operator of Calling number';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_SERVICE_TYPE	IS '	"Called service type represents Service type of B_Party subscriber.
 i.e: Fixed, Mobile, 1800, International, Special Service Etc…"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_SUBSERVICE_TYPE	IS '	"Called subservice type represents Subservice type of B_Party subscriber.
 Mobile _ Prepaid, Mobile _ Postpaid, Voice Mail Etc.."';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_AREA_LEVEL1	IS '	"First level of B_Party Prefix area. Value can be vary based on Calling Service type Fix or Mobile
 Fix/Mobile: Island"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_AREA_LEVEL2	IS '	"Second level of B_Party Prefix area. Value can be vary based on Calling Service type Fix or Mobile
 Fix: Area Code
 Mobile: Mobile Region"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_OPERATOR	IS '	Operator of Called number';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALL_DISTANCE	IS '	Call distance represents distance between calling subscriber and called subscriber. Value is enriced by EMS with the help of NATESCA table';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_SERVED_IMSI	IS '	A_Party Telenor subscriber IMSI';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_SERVED_IMSI	IS '	B_Party Telenor subscriber IMSI';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_PARTY_LAC	IS '	A_Party Telenor LAC';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_PARTY_LAC	IS '	B_Party Telenor LAC';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.APN_ID	IS '	APN_ID reprensents Access point network';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.URL	IS '	URL reprensents IP address or complete URL';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.USAGE_TYPE	IS '	Usage type represents Callscenarios. It will only be enriched by EMS in the Case of DTAC Domestic interconnect. For Digi, Usage type will be enriched by PBSS with help of Service normalisation functionality.';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.EVENT_SOURCE_AREA_LEVEL1	IS '	This fields hold the Level1 Area of the Event Source or Switch';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.EVENT_SOURCE_AREA_LEVEL2	IS '	This fields hold the Level2 Area of the Event Source or Switch';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.EVENT_SOURCE_ID	IS '	This fields holds the Origination Switch ID, which will be MSC ID for Voice, SMSC ID for SMS, MMSC ID for MMS, IMS ID for VoLTE';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.PROCESS_DATE	IS '	"EDR Processed Time 
 Date format: DD/MM/YYYY"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.USAGE_DATE	IS '	"Session Usage Date received in EDRs.
 Date format: DD/MM/YYYY"';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.ACCOUNT_ID	IS '	Partner Account Identifier';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.PARTNER_ID	IS '	Partner Identifier';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.PRODUCT_SPEC	IS '	Product Spec Identifier';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RNC_PACKAGE	IS '	RnC Package Identifier';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RATE_CARD_GROUP	IS '	Rate Card Group Identifier';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.NO_OF_CDR	IS '	It contains number of cdr aggregated in a one row. Max value is 1 million';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RATE_TYPE	IS '	Peak, Off_Peak, Weekend, Special Days';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RATE1	IS '	Calculated rate per pulse in rate card 1. It will contains comman separated pulse if Tier Type is Increment in Rate Card 1';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_ACCOUNTED_COST1	IS '	Sum of Accounted Cost in Rate Card first Currency Code. It will contains comma separated cost if Tier Type is increment in Rate Card 1';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RATE2	IS '	Calculated rate per pulse in rate card 2. It will contains comman separated pulse if Tier Type is Increment in Rate Card 2';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_ACCOUNTED_COST2	IS '	Sum of Accounted Cost in Rate Card second Currency Code. It will contains comma separated cost if Tier Type is increment in Rate Card 2';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RATE3	IS '	Calculated rate per pulse in rate card 3. It will contains comman separated pulse if Tier Type is Increment in Rate Card 3';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_ACCOUNTED_COST3	IS '	Sum of Accounted Cost in Rate Card third Currency Code. It will contains comma separated cost if Tier Type is increment in Rate Card 3';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_DISCOUNT_AMOUNT	IS '	This field indicates sum of Discounted Amount after calculation from the ACCOUNTED_COST';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_TAX_AMOUNT	IS '	Sum of  tax amount which is added to total usage(Taxable Amount)';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_ACCOUNTED_COST	IS '	Sum of Accounted Cost( Accounted Cost 1 + Accounted Cost 2 + Accounted Cost 3 ) in Partner Currency';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RNC_PACKAGE_CURRENCY_ISO_CODE	IS '	RnC Package Currency ISO Code';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.ACCOUNTING_EFFECT	IS '	It contains CR or DR accounting effect configured in Rate Card 1';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_ACCOUNTED_TIME	IS '	It contains total sum of Accounted time as per Rate Card 1. Per session max value * noofcdr Max value';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_ACCOUNTED_VOLUME	IS '	It contains total sum of Accounted volumn as per Rate Card 1. Per session max value * noofcdr Max value';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.TL_SYS_CUR_ACCOUNTED_COST	IS '	Accounted Cost ( Accounted Cost 1 + Account Cost 2 + Accounted Cost 3) in System Currency';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_PREFIX	IS '	Calling_Prefix of Calling_Station_Id ';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_PREFIX	IS '	Called_Prefix of Called_Station_Id';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_PREFIX_NAME	IS '	Calling Prefix Name of Calling_Station_Id';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_PREFIX_NAME	IS '	Called Prefix Name of Called_Station_Id';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLING_PREFIX_GROUP	IS '	Calling Prefix Group of Calling_Station_Id';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.CALLED_PREFIX_GROUP	IS '	Called Prefix Group of Called_Station_Id';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.RE_RATING_FLAG	IS '	This flag will be set to 1 if it''s re_rated EDR';
COMMENT ON COLUMN	TBLTAGGREGATEDPARTNERUSAGE.REVERSAL_ENTRY_FLAG	IS '	This flag will be set to 1 if it''s a reversal entry of previously rated EDR due to re_rating';

CREATE TABLE TBLT_UNBILLED_USAGE (	
ACCOUNTNAME VARCHAR(50) NOT NULL, 
USAGEDATE DATE NOT NULL, 
UNBILLEDUSAGE NUMERIC(21,6),
CONSTRAINT PK_UNBILLED_USAGE PRIMARY KEY (ACCOUNTNAME, USAGEDATE)
);
   
COMMENT ON COLUMN	TBLT_UNBILLED_USAGE.ACCOUNTNAME	IS 	'Account-ID  whose record is present in this row';
COMMENT ON COLUMN	TBLT_UNBILLED_USAGE.USAGEDATE	IS 	'Stores the usage date.';
COMMENT ON COLUMN	TBLT_UNBILLED_USAGE.UNBILLEDUSAGE	IS 	'Stores the total unbilled usage for this account on this particular usage date';

CREATE TABLE TBLM_LDAP_AUTH_CONF(
